import React from "react";

const Music = () => {
    return (
    <div>
        <div class="container">
            <h1>Måneskin</h1>
            <h3>Участники группы:</h3>
            <dt>Вокалист Дамиано Давид</dt>
            <dt>Басистка Виктория Де Анджелис</dt>
            <dt>Гитарист Томас Раджи</dt>
            <dt>Барабанщик Итан Торкио</dt>
        </div>
        <div class="albums_cont">
            <div class="album">
                <img src='./music1.png' alt="123" class="book"></img>
                <h3>Il ballo della vita</h3>
            </div>
            <img src='./music2.jpg' alt="123" class="book"></img>
            <img src='./music3.jpg' alt="123" class="book"></img>
        </div>
    </div>
    );
};

export default Music;
